import React, { useEffect, useState } from 'react';
import TopList from './../Top50';

async function Player() {
    const [ topArtistas, setTopArtistas ] = useState({});

    useEffect(() => {
        fetch('http://ws.audioscrobbler.com/2.0/?method=chart.gettopartists&api_key=cfedf7f80f5776d69845ed9dd0b397e3&format=json')
            .then(response => {
                return response.json();
            })
            .then(async (data) => {
                await setTopArtistas(data);
                return(
                    <div>
                        <div className="list">
                            {/* {JSON.stringify(topArtistas)} */}
                            <TopList artistas={topArtistas} />
                        </div>
                    </div>
                );
            })
    }, []);
}

export default Player;
